import { Box, Typography, Grid, Paper,MenuItem,TextField } from '@mui/material'
import HelpOutlinedIcon from '@mui/icons-material/HelpOutlined';
import { useNavigate } from 'react-router-dom';
import { useDispatch, useSelector } from 'react-redux';
import React, { useEffect, useState } from "react";
import { connect } from 'react-redux';
import { useParams } from "react-router";
import { toast } from "react-toastify";
import { updateContact } from '../Reducer/action';
const account = [
  {
    value:'Stock',
    label: 'Stock', 
  },
  {
    value:'Demat',
    label: 'Demat', 
  },
  {
    value:'Savings',
    label:'Savings'
  }

];

export const Edit = ({contact,updateContact}) => {
  const { id } = useParams();
 const navigate = useNavigate();
 const dispatch = useDispatch() ;
 const contacts = useSelector((state) => state);
  // const contact = contacts.find(
  //   (contact) => contact.id === parseInt(id)
  // );



  // const [name, setName] = useState("");
  // const [type, setType] = useState("");
  // const [code,setCode] = useState("");
  // const [description, setDescription] = useState("");
  const [newAccount, setNewAccount] = useState({});

  useEffect(() => {

    setNewAccount(contact)
  }, [contact]);


  const handleInputChange = (event) => {
    const { name, } = event.target;
    setNewAccount({ ...newAccount, [name]: value });
  };

  const handleSave = () => {
    updateContact(contact.id, newAccount);
    navigate('/');
  };


  return (
    <div className="container">
      <div >
        <button
         style={{ height: '40px', width: '75px', backgroundColor: '#CF4B28', color: 'white', border: '1px solid #CF4B28', borderRadius: '5px', fontWeight: 'bold' }} 
          onClick={() => navigate("/user-list")}
        >
          Go back
        </button>
        <div >
          {contacts ? (
             <form>
             <Typography sx={{ fontSize: '20px' }}>Edit Account</Typography>
             <Box>
               <label>
                 <Typography mt={5} mb={1} sx={{ fontSize: "16px", color: "#BD4C46" }}>
                   Account Name
                 </Typography>
               </label>

               <input
                 type='text'
                 value={newAccount.name} onChange={handleInputChange}

                 style={{ height: '30px', width: '250px' }}
               />
             </Box>

             <Box>
               <label>
                 <Typography mt={3} mb={1} sx={{ fontSize: "16px", }}>
                   Account Code <HelpOutlinedIcon sx={{ height: '18px', position: 'absolute', marginTop: '2px' }} />
                 </Typography>
               </label>

               <input
                 type='text'

                 value={newAccount.code} onChange={handleInputChange}
                 style={{ height: '30px', width: '250px' }}
               />
             </Box>

             <Box>
               <label>
                 <Typography mt={3} mb={1} sx={{ fontSize: "16px", color: "#BD4C46" }}>
                   Account Type
                 </Typography>
               </label>
               <TextField
         id="outlined-select-currency"
         select
         label="Select"
         defaultValue="EUR"

         value={newAccount.type}
         onChange={handleInputChange}
       >
         {account.map((option) => (
           <MenuItem key={option.value} value={option.value}>
             {option.label}
           </MenuItem>
         ))}
       </TextField>


             </Box>

             <Box>
               <label>
                 <Typography
                   mt={3}
                   mb={1}
                   sx={{ fontSize: "16px", color: "#000" }}
                 >
                   Description
                 </Typography>
               </label>

               <textarea
                 rows={3}
                 cols={25}
                 placeholder="Max 500 characters"
                 value={newAccount.description}
                onChange={handleInputChange}
                 style={{
                   padding: "10px",
                   borderRadius: "2px",
                   border: "1px solid gray",
                   fontFamily: 'sans-serif',
                   fontSize: '15px'
                 }}
               />
             </Box>

             <Box>
               <Typography mt={3}><input type="checkbox"  ></input>
                 <label style={{ fontFamily: 'inherit', marginLeft: '5px' }}>Add to the watchlist on my dashboard</label></Typography>
             </Box>

             <Box mt={6} >
               <button style={{ height: '40px', width: '65px', backgroundColor: '#CF4B28', color: 'white', border: '1px solid #CF4B28', borderRadius: '5px', fontWeight: 'bold' }} 
                onClick={handleSave} >Save</button>
               <button style={{ height: '40px', width: '65px', marginLeft: '11px', backgroundColor: 'lightgrey', border: '1px solid lightgray', borderRadius: '5px' }}>Cancel</button>
             </Box>



           </form>
          ) : (
            <h1 className="text-center">No Contact Found</h1>
          )}
        </div>
      </div>
    </div>
  );

 }
  // const mapStateToProps = (state) => ({
  //   contacts: state.data,
  // });
// const mapDispatchToProps = (dispatch) => ({
//   updateContact: (data) => {
//     dispatch({ type: "UPDATE_CONTACT", payload: data });
//   },
// });


const mapStateToProps = (state, ownProps) => {
  const { id } = ownProps.match.params;
  const data = state.data.find((contact) => contact.id === id);
  return {
    data,
  };
};

const mapDispatchToProps = {
  updateContact,
};
 export default connect(mapStateToProps,mapDispatchToProps)(Edit);
